import logo from './logo.svg';
import './App.css';
import ReactDOM from 'react-dom';

class App extends React.Component {
  render() {
    return <div>Hello {this.props.sd}</div>;
  }
}

ReactDOM.render(
  <App name="World" sd="Abhinav" />,
  document.getElementById('container')
);
export default App;
